import React from "react";
import { Redirect } from "react-router-dom";
import {
  DashboardContainer,
  Dashboard,
  DashBoardContent,
  DashboardList,
  DashboardListItem,
} from "./AdminProfileElements.js";
import { BiPackage } from "react-icons/bi";

export const AdminProfile = ({ authorized }) => {
  if (!authorized) {
    return <Redirect to="/LogIn" />;
  }

  const nom = localStorage.getItem("nom");
  const prenom = localStorage.getItem("prenom");
  return (
    <DashboardContainer>
      <h1>
        Bienvenue {nom} {prenom}
      </h1>
      <Dashboard>
        <DashboardList>
          <DashboardListItem>Gestion de produits</DashboardListItem>
          <DashboardListItem>Gestion des utilisateurs</DashboardListItem>
        </DashboardList>

        <DashBoardContent>Gestion Produit</DashBoardContent>
      </Dashboard>
    </DashboardContainer>
  );
};
export default AdminProfile;
